import { Divider } from "@mui/material";

interface Props {
  first: string;
  second: string;
}

export const InfoItem: React.FC<Props> = (info) => {
  return (
    <>
      <div style={{display: "flex", justifyContent: "space-between", marginTop: "1rem"}}>
        <span>{info.first}</span>
        <span>{info.second}</span>
      </div>
      <Divider light />
    </>
  );
};
